import React from 'React';
import Header from '../components/Header';
class Index extends React.Component {

    render() {
        const links = [{
            path: '/',
            name: "Home"
        },
        {
            path: 'about',
            name: 'About'
        }
        ];
        return (
            <div>
                <Header links={links}></Header>
                <div>seiji</div>
                <div>Hello world</div>
            </div>
        )
    }
}
export default Index;
